function About() {

  return (
    <section id='about' className='sectionBackground'>
      <section className='sectionContents'>
        <h2>About Me</h2>
        <article>
          <p>Hey there! First I would like to thank you for checking out my presentation website.</p>
          <div className='three-col-grid'>
            <div className='col-grid'>
              <p>ICON</p>
              <p>Text</p>
            </div>
          </div>
        </article>
      </section>
    </section>
  );
}

export default About;
